import React from "react";

type OnboardingCtxt = {
    step: number,
    userId: number,
    name: string,
    surname: string,
    productId: string,
    setStep: (step: number) => void 
    setProductId: (productId: string) => void 
}

export const initialOnboarding: OnboardingCtxt = {
    step: 0,
    userId: 0,
    name: "",
    surname: "",
    productId: "",
    setStep: (step: number) => {},
    setProductId: (productId: string) => {}
}

export const OnboardingContext = React.createContext<OnboardingCtxt>(initialOnboarding);
